import React from 'react';
import { Link } from 'react-router-dom';
import Carousel from '../components/Carousel';
import './Inicio.css';

function Inicio() {
  return (
    <div className="inicio-page">
      {/* Espaço para o Carrossel */}
      <div className="carousel-placeholder">
        <Carousel />
      </div>

      {/* Container das seções, com layout horizontal */}
      <div className="sections-container">
        {/* Seção Frete de Ônibus */}
        <Link to="/alugueldeonibus" className="section-link">
          <div className="section-box">
            <img src="/path/to/your-image1.jpg" alt="Frete de Ônibus" />
            <div className="section-inner">Frete de Ônibus</div>
          </div>
        </Link>

        {/* Seção Nossa Frota */}
        <Link to="/nossafrota" className="section-link">
          <div className="section-box">
            <img src="/path/to/your-image2.jpg" alt="Nossa Frota" />
            <div className="section-inner">Nossa Frota</div>
          </div>
        </Link>

        {/* Seção Turismo */}
        <Link to="/turismo" className="section-link">
          <div className="section-box">
            <img src="/path/to/your-image3.jpg" alt="Turismo" />
            <div className="section-inner">Turismo</div>
          </div>
        </Link>
      </div>
    </div>
  );
}

export default Inicio;
